window.bookSummaryJSON = "<p><b>Contains </b><b><i>Legion </i></b><b>(book nine) and </b><b><i>Twin Portals </i></b><b>(book ten) of the Legend of the Arch Magus series.</b></p> <p>An Arch Magus dies, only to find himself in the body of a young man in a medieval Kingdom. He finds out that he is the second son of a Duke, exiled to a desolated town by his own family. Shackled by the notorious reputation of his new shell, he tries his best to develop his domain, implementing new policies and innovations, leading his subjects to prosperity. In this world where magic is undeveloped, he shall once again pave a new path.</p>"; 
